import React from 'react';
import Head from 'next/head';

interface Props {
  text?: string;
}

const Layout: React.FunctionComponent<Props> = ({ children, text }) => (
  <>
    <Head>
      <style>
        {text}
      </style>
    </Head>
    {children}
  </>
);

export default Layout;
